                "friendsofphp/php-cs-fixer": "^3.0",
                "phpunit/phpunit": "^9.5"
            },
            "default-branch": true,
            "bin": [
                "cghooks"
            ],
            "type": "library",
            "extra": {
                "hooks": {
                    "pre-commit": "composer check-style",
                    "pre-push": [
                        "composer test",
                        "appver=$(grep -o -E '\\d.\\d.\\d(-alpha.\\d)?' cghooks)",
                        "tag=$(git tag | tail -n 1)",
                        "if [ \"$tag\" != \"v$appver\" ]; then",
                        "echo \"The most recent tag $tag does not match the application version $appver\\n\"",
                        "tag=${tag#v}",
                        "sed -i -E \"s/$appver/$tag/\" cghooks",
                        "exit 1",
                        "fi"
                    ]
                }
            },
            "autoload": {
                "psr-4": {
                    "BrainMaestro\\GitHooks\\": "src/"
                },
                "files": [
                    "src/helpers.php"
                ]
            },
            "autoload-dev": {
                "psr-4": {
                    "BrainMaestro\\GitHooks\\Tests\\": "tests/"
                }
            },
            "scripts": {
                "test": [
                    "vendor/bin/phpunit"
                ],
                "post-install-cmd": [
                    "./cghooks add --ignore-lock"
                ],
                "post-update-cmd": [
                    "./cghooks update"
                ],
                "check-style": [
                    "php-cs-fixer fix --using-cache=no --diff --dry-run ."
                ],
                "fix-style": [
                    "php-cs-fixer fix --using-cache=no ."
                ]
